DROP TABLE IF EXISTS `promocion`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `promocion` (
  `idPromocion` int NOT NULL AUTO_INCREMENT,
  `idEmpresa` int NOT NULL,
  `nombrePromocion` varchar(45) NOT NULL,
  `descripcion` varchar(100) NOT NULL,
  `imagenPromocion` mediumblob,
  `fechaInicioPromocion` date NOT NULL,
  `fechaTerminoPromocion` date NOT NULL,
  `restricciones` varchar(100) NOT NULL,
  `idTipoPromocion` int NOT NULL,
  `porcentaje_Costo` int NOT NULL,
  `idCategoria` int NOT NULL,
  `cuponesMaximos` int NOT NULL,
  `codigoPromocion` varchar(8) NOT NULL,
  `estatus` bit(1) NOT NULL DEFAULT b'1',
  PRIMARY KEY (`idPromocion`),
  UNIQUE KEY `codigoPromocion` (`codigoPromocion`),
  KEY `FK_Promocion_Empresa_idx` (`idEmpresa`),
  KEY `FK_Promocion_Categoria_idx` (`idCategoria`),
  KEY `FK_Promocion_TipoDescuento_idx` (`idTipoPromocion`),
  CONSTRAINT `FK_Promocion_Categoria` FOREIGN KEY (`idCategoria`) REFERENCES `cat_categoria` (`idCategoria`),
  CONSTRAINT `FK_Promocion_Empresa` FOREIGN KEY (`idEmpresa`) REFERENCES `empresa` (`idEmpresa`) ON DELETE RESTRICT ON UPDATE RESTRICT,
  CONSTRAINT `FK_Promocion_TipoDescuento` FOREIGN KEY (`idTipoPromocion`) REFERENCES `cat_tipopromocion` (`idTipoPromocion`)
) ENGINE=InnoDB AUTO_INCREMENT=23 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
